from math import comb


class Solution:

    def reverse_number(self, num: int) -> int:
        reversed_num = 0

        while num != 0:
            digit = num % 10
            reversed_num = reversed_num * 10 + digit
            num = num // 10

        return reversed_num

    def countNicePairs(self, nums: list[int]) -> int:
        frequency = {}
        length = len(nums)
        count: int = 0
        for i in range(length):
            for j in range(i + 1, length):
                a = nums[i] + self.reverse_number(nums[j])
                b = nums[j] + self.reverse_number(nums[i])

                # print(nums[i], nums[j])
                # print("\t", a, b, a == b)
                if a == b:
                    count += 1
        return count

    def countNicePairs2(self, nums: list[int]) -> int:
        frequency = {}

        for i in range(len(nums)):
            res = nums[i] - self.reverse_number(nums[i])

            if res in frequency:
                nums[i] = res
                frequency[res] = frequency[res] + 1
                continue
            frequency[res] = 1
            nums[i] = res
        print(frequency)
        print(nums)
        nice_pair_count = 0
        for i in frequency:
            nice_pair_count += (frequency[i]//2)

        return nice_pair_count

    def countNicePairs3(self, nums: list[int]) -> int:
        frequency = {}
        nice_pairs = 0
        mod = 1000000007
        for n in nums:
            val = n - self.reverse_number(n)
            current_frequency = frequency.get(val, 0)
            print(n, val, current_frequency, current_frequency + 1)
            nice_pairs += current_frequency
            frequency[val] = current_frequency + 1

        # print(frequency)
        # print(nums)

        return nice_pairs % mod

    def countNicePairs_o_1(self, nums):
        numbers = {}

        for num in nums:
            temporary_number = num - self.reverse_number(num)

            if temporary_number in numbers:
                numbers[temporary_number] += 1
            else:
                numbers[temporary_number] = 1

        result = 0
        mod = 1000000007
        print(numbers)
        for value in numbers.values():
            print(
                value, " \t- " f"{result} % {mod} + ({value} * ({value - 1}) // {2}) % {mod} = {(result % mod + (value * (value - 1) // 2)) % mod}")
            print(
                "\t- " f"{result % mod} + ({value * (value - 1)} // {2}) % {mod} = {(result % mod + (value * (value - 1) // 2)) % mod}")
            print(
                "\t- " f"{result % mod} + ({value * (value - 1) // 2}) % {mod} = {(result % mod + (value * (value - 1) // 2)) % mod}")
            print(
                "\t- " f"{result % mod + (value * (value - 1) // 2) % mod} = {(result % mod + (value * (value - 1) // 2)) % mod}")
            result = (result % mod + (value * (value - 1) // 2)) % mod

        return int(result)

    def countNicePairS_o_2(self, nums: list[int]) -> int:
        res = 0
        count = {}
        mod = 10**9 + 7

        for n in nums:
            rev = int(str(n)[::-1])
            cur = count.get(n - rev, 0)
            res += cur
            count[n - rev] = 1 + cur

        return res % mod


